import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

notes.map((note) => (
  <Note key={note.id} title={note.title} content={note.content} />
));

function App() {
  return (
    <div>
      <Header />

      <Footer />
    </div>
  );
}

export default App;
